// Menu.js
import React from "react";

function Menu() {
  return (
    <div style={styles.container}>
      <h1 style={styles.text}>Our Menu Is Under Construction. Please come back soon...</h1>
    </div>
  );
}

const styles = {
  container: {
    minHeight: "100vh",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
  },
  text: {
    fontSize: "1.8rem",
    color: "#444",
    fontStyle: "italic",
  },
};

export default Menu;
